        playPauseButton.addEventListener('click', () => {
            if (positivity.style.animationPlayState === 'paused') {
                positivity.style.animationPlayState = 'running';
                playPauseButton.innerHTML = '<i class="fas fa-pause"></i>';
            } else {
                positivity.style.animationPlayState = 'paused';
                playPauseButton.innerHTML = '<i class="fas fa-play"></i>';
            }
        });
